import './Header.scss';
import { NavLink } from 'react-router-dom';

export default function Header(props) {
    return (
        <header className="Header">
            <nav>
                {
                    props.pages.map(
                        page => 
                        (page.slug == 'accueil')
                        ?
                        <NavLink to={'/'}>{page.title.rendered}</NavLink>
                        :
                        <NavLink to={'/' + page.slug}>page.title.rendered</NavLink>
                    )
                }
                <NavLink to="/">Accueil</NavLink>
                <NavLink to="/cours">Cours</NavLink>
            </nav>
        </header>
    );
}
